import React from 'react';
import './App.scss';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages/HomeContainer';
import DocumentContainer from './pages/DocumentContainer';
import UsersContainer from './pages/UsersContainer';
import CourseContainer from './pages/CourseContainer';
import routeItems from './helpers/constants/routeItems';

function App() {
  return (
    <div>
      <Router>
        <Routes>
          <Route path="/" element={<Home />} exact />
          {
            routeItems.map((route) => {

            })
          }
          <Route path="/courses" element={<CourseContainer />} />
          <Route path="/document" element={<DocumentContainer />} />
          <Route path="/users" element={<UsersContainer />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
